const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XVI", "p": 410}, {"t": "text", "c": ["- Que me conseillez-vous d\u2019aller visiter ? demanda-t-il."], "p": 410}, {"t": "text", "c": ["- La plan\xE8te Terre, lui r\xE9pondit le g\xE9ographe.", "Elle a une bonne r\xE9putation\u2026", "Et le petit prince s\u2019en fut, songeant \xE0 sa fleur."], "p": 411}, {"t": "text", "c": ["La septi\xE8me plan\xE8te fut donc la Terre."], "p": 413}, {"t": "text", "c": ["La Terre n\u2019est pas une plan\xE8te quelconque !", "On y compte cent onze rois (en n\u2019oubliant pas, bien s\xFBr, les rois n\xE8gres), sept mille g\xE9ographes, neuf cent mille businessmen, sept millions et demi d\u2019ivrognes, trois cent onze millions de vaniteux, c\u2019est-\xE0-dire environ deux milliards de grandes personnes."], "p": 414}, {"t": "text", "c": ["Pour vous donner une id\xE9e des dimensions de la Terre je vous dirai qu\u2019avant l\u2019invention de l\u2019\xE9lectricit\xE9 on y devait entretenir, sur l\u2019ensemble des six continents, une v\xE9ritable arm\xE9e de quatre cent soixante-deux mille cinq cent onze allumeurs de r\xE9verb\xE8res."], "p": 415}]}';export{e as default};
